"the experience was nice. Unlike other interviews I have been involved in, the meetings with the toughbyte team were brief and to the point, the team gave me ample time to answer the questions pitched to me and would occasionally rephrase and simplify the questions to make it easier for me to answer them. Viktoriya at first contact explained everything that I would experience at the interview and was very receptive and welcoming of me and also answered all my questions. The convenience that came with having the ability to choose my own meeting time was also a wonderful touch."

@Viktoriya Finagenova CC @Ekaterina Bulanova
